import{_ as e,o as a,c as t,O as i}from"./chunks/framework.9482e208.js";const m=JSON.parse('{"title":"§ 13.1-1064 Penalty for failure to timely pay annual registration fees.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/13.1-1064.md","filePath":"vacode/13.1-1064.md"}'),r={name:"vacode/13.1-1064.md"},n=i('<h1 id="§-13-1-1064-penalty-for-failure-to-timely-pay-annual-registration-fees" tabindex="-1">§ 13.1-1064 Penalty for failure to timely pay annual registration fees. <a class="header-anchor" href="#§-13-1-1064-penalty-for-failure-to-timely-pay-annual-registration-fees" aria-label="Permalink to &quot;§ 13.1-1064 Penalty for failure to timely pay annual registration fees.&quot;">​</a></h1><p>A. Any domestic or foreign limited liability company, or any protected series thereof, that fails to pay the annual registration fee into the state treasury within the time prescribed in § <a href="/vacode/13.1-1062/">13.1-1062</a> shall incur a penalty of $25, which shall be added to the amount of the annual registration fee due. The penalty prescribed herein shall be in addition to any other penalty or liability imposed by law.</p><p>B. The Commission shall mail to each domestic and foreign limited liability company that fails to pay the annual registration fee within the time prescribed in § <a href="/vacode/13.1-1062/">13.1-1062</a> a notice of assessment of the penalty imposed herein and of the impending cancellation of its existence or certificate of registration, as the case may be.</p><p>C. The Commission shall mail to each protected series and each foreign protected series that fails to pay the annual registration fee within the time prescribed in § <a href="/vacode/13.1-1062/">13.1-1062</a> a notice of assessment of the penalty imposed herein and of its impending cancellation or the impending cancellation of its certificate of registration, as the case may be.</p><p>1991, c. 168; 1997, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?971+ful+CHAP0190" target="_blank" rel="noreferrer">190</a>; 2000, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?001+ful+CHAP0052" target="_blank" rel="noreferrer">52</a>; 2004, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?041+ful+CHAP0274" target="_blank" rel="noreferrer">274</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?041+ful+CHAP0601" target="_blank" rel="noreferrer">601</a>; 2005, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?051+ful+CHAP0255" target="_blank" rel="noreferrer">255</a>; 2008, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?081+ful+CHAP0108" target="_blank" rel="noreferrer">108</a>; 2019, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?191+ful+CHAP0636" target="_blank" rel="noreferrer">636</a>.</p>',5),o=[n];function l(s,c,f,h,p,g){return a(),t("div",null,o)}const _=e(r,[["render",l]]);export{m as __pageData,_ as default};
